  //   };
  //   fetchSessions();
  // }, [setName]);

  const toggleSlider = () => {
    setIsSliderOpen(!isSliderOpen);
  };

  return (
    <div>
      <div>
        <Sessions toggleSlider={toggleSlider} name={name} />
      </div>

      {isSliderOpen && (
        <Slider closeSlider={toggleSlider} />
      )}
    </div>
  );
}

export default Appointment;
